import React, { useState } from 'react';
import ReactDOM from 'react-dom';

export default ({ getPossibleDates }) => {
	const [possibleDates, setPossibleDates] = useState(['test', 'lol']);

	const handleDelete = e => {
		e.target.parentElement.remove();
	};

	const generateField = () => {
		console.log('qoqq');
		let x = React.createElement('h1', { id: 'abc' }, 'asd');
		ReactDOM.render(x, document.getElementById('generatetohere'));
		// React.createElement('h1');
	};

	return (
		<div>
			<br />
			<div className="columns">
				<div className="column"></div>
				<div className="column is-5">
					<div className="box" style={{ backgroundColor: '#C8E4FF' }}>
						<div className="field">
							<label className="label has-text-weight-normal">Enter possible dates below</label>
							<div className="field-body">
								<div className="field is-expanded">
									{/* <div className="field has-addons possible-dates-field">
										<p className="control is-expanded">
											<input
												className="input possible-dates-input"
												type="text"
												value={possibleDates}
												onChange={e => {
													setPossibleDates(e.target.value);
												}}
											/>
										</p>

										<p className="control" onClick={handleDelete}>
											<a className="button is-static">
												<i className="fas fa-trash-alt"></i>
											</a>
										</p>
									</div>

									<br />

									<div className="field has-addons possible-dates-field" onClick={generateField}>
										<p className="control is-expanded">
											<input
												className="input possible-dates-input"
												type="text"
												value={possibleDates}
												onChange={e => {
													setPossibleDates(e.target.value);
												}}
											/>
										</p>

										<p className="control" onClick={handleDelete}>
											<a className="button is-static">
												<i className="fas fa-trash-alt"></i>
											</a>
										</p>
									</div> */}

									{possibleDates.map(item => (
										<div className="field has-addons possible-dates-field">
											<p className="control is-expanded">
												<input className="input possible-dates-input" type="text" />
											</p>

											<p className="control" onClick={handleDelete}>
												<a className="button is-static">
													<i className="fas fa-trash-alt"></i>
												</a>
											</p>
										</div>
									))}

									<div id="generatetohere"></div>
								</div>
							</div>
						</div>

						<br />

						<a
							className="button is-small is-link"
							onClick={() => {
								getPossibleDates(possibleDates);
							}}>
							Next
						</a>
					</div>
				</div>
				<div className="column"></div>
			</div>
			<br />
			<br />
		</div>
	);
};
